import React from 'react';
import './SearchBar.css';

const SearchBar = () => {
  return (
    <div className="searchbar">
      <input
        className="search_input"
        type="text"
        id="search"
        placeholder="Search"
      ></input>
    </div>
  );
};

export default SearchBar;
